import classes from "./Header.module.css";
import Search from "./Search";

const Header = () => {
  return (
    <div className={classes.setbg}>
      <h2 className={classes.create}>Most Popular Users of Github!</h2>
      <br />
      <div className={classes.align}>
        <Search />
      </div>
    </div>
  );
};

export default Header;
